import React from 'react';
import Card from '../Components/Card';


const Home = () => {
  return (
    <>
      {
        [1, 2, 3, 4, 5, 6, 7, 7, 99, 6, 4, 2].map((itm, idx) => (
          <Card key={idx} />
        ))
      }
    </>
  );
}

export default Home;
